class FaceGraphics {
  scene;
  physicsSystem;
  triangles;
  constructor(scene, physicsSystem) {
    this.scene = scene;
    this.physicsSystem = physicsSystem;
    const faceMaterial = new MeshPhysicalMaterial({
      color: 13087387,
      roughness: 1,
      transparent: true,
      opacity: 0.8,
      side: DoubleSide
    });
    const engineMaterial = new MeshBasicMaterial({
      color: 16777215,
      roughness: 0,
      side: DoubleSide
    });
    this.triangles = [];
    for (let i = 0;i < physicsSystem.faces.length; i++) {
      const geometry = new BufferGeometry;
      geometry.name = `triangle-${i}`;
      const [a, b, c] = physicsSystem.faces[i].vertexIndices;
      geometry.setFromPoints([a, b, c].map((x2) => new Vector3(...physicsSystem.vertexPositions[x2])));
      const triangle = new Mesh(geometry, physicsSystem.faces[i].constructor.name == "Engine" ? engineMaterial : faceMaterial);
      scene.add(triangle);
      triangle.frustumCulled = false;
      this.triangles.push(triangle);
      triangle.name = `triangle-${i}`;
    }
    this.update();
  }
  update() {
    for (let faceIdx = 0;faceIdx < this.physicsSystem.faces.length; faceIdx++) {
      const triangle = this.triangles[faceIdx];
      const positions = triangle.geometry.attributes.position;
      let vertexIndices = this.physicsSystem.faces[faceIdx].vertexIndices;
      for (let i = 0;i < vertexIndices.length; i++) {
        let vi = vertexIndices[i];
        let pos = this.physicsSystem.vertexPositions[vi];
        positions.setXYZ(i, pos[0], pos[1], pos[2]);
      }
      positions.needsUpdate = true;
      if (faceIdx == 0) {
        const force = this.physicsSystem.faces[faceIdx].force;
        triangle.material.color = new Color(Math.min(force, 1) - Math.max(force - 3.5, 0), Math.max(Math.min(force - 1.5, 1), 0) * 0.8, Math.max(Math.min(force - 2.5, 1), 0));
        triangle.color_needs_update = true;
      }
      triangle.geometry.computeVertexNormals();
    }
  }
  dispose() {
    this.triangles.forEach((triangle) => {
      this.scene.remove(triangle);
      triangle.geometry.dispose();
      triangle.material.dispose();
    });
  }
}

// labelGraphics.ts
var createTextSprite = function(message, fontsize, fontface, color) {
  const canvas = document.createElement("canvas");
  const context = canvas.getContext("2d");
  context.font = `${fontsize}px ${fontface}`;
  const metrics = context.measureText(message);
  const textWidth = metrics.width;
  canvas.width = textWidth;
  canvas.height = fontsize * 1.4;
  context.fillStyle = "rgba(255, 255, 255, 0.0)";
  context.fillRect(0, 0, canvas.width, canvas.height);
  context.font = `${fontsize}px ${fontface}`;
  context.fillStyle = color;
  context.textAlign = "center";
  context.textBaseline = "middle";
  context.fillText(message, canvas.width / 2, canvas.height / 2);
  const texture = new CanvasTexture(canvas);
  const spriteMaterial = new SpriteMaterial({ map: texture });
  const sprite = new Sprite(spriteMaterial);
  sprite.scale.set(0.4, 0.4, 1);
  return sprite;
};

class LabelGraphics {
  scene;
  physicsSystem;
  labels;
  constructor(scene, physicsSystem) {
    this.scene = scene;
    this.physicsSystem = physicsSystem;
    this.labels = [];
    physicsSystem.vertexPositions.forEach((vertex2, index) => {
      const label = createTextSprite(`${index}`, 48, "Arial", "rgba(255, 255, 0, 1)");
      label.position.set(...vertex2);
      scene.add(label);
      this.labels.push(label);
    });
  }
  update() {
    for (let i = 0;i < this.physicsSystem.vertexPositions.length; i++) {
      this.labels[i].position.set(...this.physicsSystem.vertexPositions[i]);
    }
  }
  dispose() {
    this.labels.forEach((label) => {
      this.scene.remove(label);
    });
  }
  setVisible() {
    this.labels.forEach((label) => {
      label.visible = true;
    });
  }
  setInvisible() {
    this.labels.forEach((label) => {
      label.visible = false;
    });
  }
}

