    this.colors[nextIndex * 3] = Math.min(force, 1) - Math.max(force - 3.5, 0);
    this.colors[nextIndex * 3 + 1] = Math.max(Math.min(force - 1.5, 1), 0) * 0.8;
    this.colors[nextIndex * 3 + 2] = Math.max(Math.min(force - 2.5, 1), 0);
