class SpringGraphics {
  scene;
  physicsSystem;
  cylindersInstancedMesh;
  constructor(scene, physicsSystem) {
    this.scene = scene;
    this.physicsSystem = physicsSystem;
    const cylinderGeometry = new CylinderGeometry(0.03, 0.03, 1);
    const cylinderMaterial = new MeshPhysicalMaterial;
    const instanceCount = physicsSystem.springs.length;
    this.cylindersInstancedMesh = new InstancedMesh(cylinderGeometry, cylinderMaterial, instanceCount);
    this.cylindersInstancedMesh.frustumCulled = false;
    this.cylindersInstancedMesh.name = "cylinders";
    scene.add(this.cylindersInstancedMesh);
  }
  update() {
    for (let i = 0;i < this.physicsSystem.springs.length; i++) {
      const spring = this.physicsSystem.springs[i];
      const from = new Vector3(...this.physicsSystem.vertexPositions[spring.fromIdx]);
      const to = new Vector3(...this.physicsSystem.vertexPositions[spring.toIdx]);
      const direction = new Vector3().subVectors(to, from);
      const orientation = new Matrix4;
      const midpoint = new Vector3().addVectors(from, to).multiplyScalar(0.5);
      const scale = direction.length();
      const quaternion = new Quaternion().setFromUnitVectors(new Vector3(0, 1, 0), direction.normalize());
      orientation.makeRotationFromQuaternion(quaternion);
      orientation.setPosition(midpoint);
      const scaleMatrix = new Matrix4().makeScale(1, scale, 1);
      orientation.multiply(scaleMatrix);
      this.cylindersInstancedMesh.setMatrixAt(i, orientation);
      let color;
      const stretchFactor = (scale / (scale + spring.restLength) + 0.5) ** 5 - 0.5;
      if (stretchFactor > 0.5) {
        color = new Color(stretchFactor, 1 - stretchFactor, 1 - stretchFactor);
      } else {
        color = new Color(1 - stretchFactor, 1 - stretchFactor, stretchFactor);
      }
      this.cylindersInstancedMesh.setColorAt(i, color);
    }
    this.cylindersInstancedMesh.instanceColor.needsUpdate = true;
    this.cylindersInstancedMesh.instanceMatrix.needsUpdate = true;
  }
  dispose() {
    this.cylindersInstancedMesh.geometry.dispose();
    this.cylindersInstancedMesh.material.dispose();
    this.scene.remove(this.cylindersInstancedMesh);
  }
}

